import React from 'react';
import axios from 'axios';
import { IonContent, IonGrid, IonHeader, IonPage, IonRow, IonTitle, IonToolbar } from '@ionic/react';
import ExploreContainer from '../components/ExploreContainer';
import './Tab1.css';
import {IonCard , IonCardHeader,IonButton, IonCardSubtitle, IonCardTitle , IonCardContent, IonCol} from '@ionic/react';

/* Usando fetch */
const Fetching = async () => {
  const ret = await fetch('http://localhost:25000/perfiles');
  const json = await ret.json();
  return json;
}

/* Usando Axios */
const RequestToMyApi = () => {
  return axios({
    url: 'http://localhost:25000/perfiles',
    method: 'get'
  }).then(response => {
    return response.data;
  })
};

const Tab1: React.FC = () => {

  const [players, setPlayers] = React.useState([]);

  React.useEffect(() => {
    RequestToMyApi().then(data => setPlayers(data))
  }, []);

   return (
    <IonPage >
      <IonHeader>
        <IonToolbar>
          <IonTitle>Tab 1</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent className='fondo' >
        <IonGrid>
          <IonRow>
            <IonCol>
              <IonButton expand="block">Block Button</IonButton>
            </IonCol>
            <IonCol>

            </IonCol>
          </IonRow>
        </IonGrid>


      </IonContent>

    </IonPage>
  );
};

export default Tab1;
